import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Exportando os ícones diretamente
export const SearchIcon = BsSearch;
export const ChartIcon = BsBarChart;
export const GearIcon = BsGear;
export const FileIcon = BsFileText;
export const FilterIcon = BsFilter;
export const SaveIcon = BsSave;
export const TrashIcon = BsTrash;
